import React from 'react';

function hello() {
  return (
    <div class="hello">
      <h1>Name:{this.pops.name}</h1>
      <p>Education:{this.pops.edu}</p>
      <p>Email:{this.pops.email}</p>
    </div>
  );
}

export default hello;
